import { styled } from "styled-components";



export const Wrapper = styled.section `

margin:10px 10%;
    .field{
        margin-left:35%;
    }
    input{
        background-color:#007BFF;
        border:none;
        padding:10px;
        margin:10px;
    }
    input:first-child{
        margin-left:10px;
    }
`
